import React from 'react';
import PropTypes from 'prop-types';

// Utils
import { get } from '../api/callers';

// Styling
import { Flex, Box } from '../components/styles';

const Home = ({ layouts }) => {
  console.log(layouts);

  return (
    <Flex>
      <Box>
        <h1>Home</h1>
      </Box>
    </Flex>
  );
};

Home.getInitialProps = async () => {
  const layouts = await get('cases/').then(resp => resp?.layouts);

  return { layouts };
};

Home.propTypes = {
  layouts: PropTypes.arrayOf(PropTypes.object),
};

Home.defaultProps = {
  layouts: [],
};

export default Home;
